            ['jenis_nomenklatur' => 3, 'nomor_kode' => '8.01.03.02.01', 'nomenklatur' => 'Perumusan Kebijakan Teknis dan Pemantapan Pelaksanaan Bidang Pendidikan Politik, Etika Budaya Politik, Peningkatan Demokrasi, Fasilitasi Kelembagaan Pemerintahan, Perwakilan dan Partai Politik, Pemilihan Umum/Pemilihan Umum Kepala Daerah, serta Pemantauan Situasi Politik'],
            ['jenis_nomenklatur' => 3, 'nomor_kode' => '8.01.04.02.01', 'nomenklatur' => 'Perumusan Kebijakan Teknis dan Pemantapan Pelaksanaan Bidang Pemberdayaan dan Pengawasan Organisasi Kemasyarakatan'],
