            ['jenis_nomenklatur' => 3, 'nomor_kode' => '8.01.06.02.01', 'nomenklatur' => 'Perumusan Kebijakan Teknis dan Pelaksanaan Pemantapan Kewaspadaan Nasional dan Penanganan Konflik Sosial'],
        ];

        foreach ($data as $item) {
            $id = DB::table('kode_nomenklatur')->insertGetId([
                'jenis_nomenklatur' => $item['jenis_nomenklatur'],
                'nomor_kode' => $item['nomor_kode'],
                'nomenklatur' => $item['nomenklatur'],
                'created_at' => $now,
                'updated_at' => $now,
            ]);

            // breakdown
            $parts = explode('.', $item['nomor_kode']); // e.g. 1.01.01.02.01
            $kode_urusan = $parts[0];
            $kode_bidang = $parts[0] . '.' . $parts[1];
            $kode_program = $parts[0] . '.' . $parts[1] . '.' . $parts[2];

            $id_urusan = DB::table('kode_nomenklatur')->where('jenis_nomenklatur', 0)->where('nomor_kode', $kode_urusan)->value('id');
            $id_bidang = DB::table('kode_nomenklatur')->where('jenis_nomenklatur', 1)->where('nomor_kode', $kode_bidang)->value('id');
            $id_program = DB::table('kode_nomenklatur')->where('jenis_nomenklatur', 2)->where('nomor_kode', $kode_program)->value('id');

            DB::table('kode_nomenklatur_detail')->insert([
                'id_nomenklatur'    => $id,
                'id_urusan'         => $id_urusan,
                'id_bidang_urusan'  => $id_bidang,
                'id_program'        => $id_program,
                'id_kegiatan'       => null,
                'id_sub_kegiatan'   => null,
                'created_at'        => $now,
                'updated_at'        => $now,
            ]);
